    <p>Vietnom</p><p>Envision Vietnam, the country: war-torn, savage and bloody through the lens of the West. A picture of political instability, restlessness and battle, embroiled in decades-long dispute and violence. A kill-or-be-killed environment where only the strong survive.
    Now step into the world of Vietnom, the band: a DMS hardcore outfit that has crawled up from the mean <a href="http://www.uprisingrecords.com/artists/the-archive/vietnom/" target="_blank">[...]</a></p>
  created_at: 2018-05-06 13:59:49.016387000 Z
  updated_at: 2018-05-06 15:29:37.657655000 Z
- code: uprising_records_http://www.uprisingrecords.com/artists/rock-division/vegan-reich/
