  url: http://www.uprisingrecords.com/artists/rock-division/vegan-reich/
  date: 2012-06-19 04:20:23.000000000 Z
  title: Vegan Reich
  body: <p>Vegan Reich</p><p>The originators of vegan straight edge, their sound invoked
    early Cro Mags with hints of Suicidal Tendencies and Bad Brains. Through several
    EP releases, Vegan Reich ushered in an era of animal liberation, human rights
    and environmentally conscious hardcore that was ever controversial in its militancy
    and equally influential, ideologically spawning the band Earth Crisis <a href="http://www.uprisingrecords.com/artists/rock-division/vegan-reich/"
    target="_blank">[...]</a></p>
