  icon: https://pbs.twimg.com/profile_images/871157543745208320/UypLf2Ti_400x400.jpg
  url: https://twitter.com/trentontws/status/984584800584351744
  date: 2018-04-13 00:11:23.000000000 Z
  title: "@trentontws on Twitter"
  body: <p class="TweetTextSize TweetTextSize--normal js-tweet-text tweet-text"  lang="en">An
    example of the first point - try singing "is this a question mark?" then with
    the same melody - "this is a question mark". No difference because you can't sing
    the upward inflection that usually implies a question (in English, at least).</p>
  created_at: 2018-05-19 06:38:09.166846000 Z
  updated_at: 2018-05-19 06:38:09.166846000 Z
- code: trenton_woodley_https://twitter.com/trentontws/status/984582717344854016
  owner: trenton_woodley
  owner_name: Trenton Woodley
  feed_type: twitter
  icon: https://pbs.twimg.com/profile_images/871157543745208320/UypLf2Ti_400x400.jpg
  url: https://twitter.com/trentontws/status/984582717344854016
  date: 2018-04-13 00:03:07.000000000 Z
  title: "@trentontws on Twitter"
  body: <p class="TweetTextSize TweetTextSize--normal js-tweet-text tweet-text"  lang="en">The
    remainder of an 'accent' is the mouth shape (frequency modulation), particularly
    in vowels, but part of singing in absolute pitch is actually restricting your
    vocal tract so 'softer' (more universal) vowel sounds are easier to sing.</p>
  created_at: 2018-05-19 06:38:09.170519000 Z
